import React, { Component } from 'react'

export default class Roomdetaillist extends Component {
    render() {
        return (
            <>
                {
                  Object.keys(this.props.data.rooms).map((data,key)=>(
                    <div className="dropdown">
                        <button className="dropbtn" key={key}>{this.props.data.rooms[data].id}</button>
                        <div className="dropdown-content">
                        {
                            Object.keys(this.props.data.rooms[data].bedList).map((d,key1)=>(
                                        <a href="#" key={key1} onClick={()=>props.addBed(this.props.data.rooms[data].bedList[d])}>{this.props.data.rooms[data].bedList[d].bed_id}</a>                          
                            ))
                        }
                        </div>
                   </div>))
                }
                <div className="amini-block">
                    <label className="amini-container">News Paper
                        <input type="checkbox"  />
                            <span className="checkmark"></span>
                    </label>
                    <label className="amini-container">Meals
                        <input type="checkbox" />
                            <span className="checkmark"></span>
                    </label>
                 </div>
            </>
        )
    }
}
